// Page-Aware Markdown Aggregation for n8n Code Node
// Use a unique delimiter that won't appear in documents
const PAGE_MARKER_START = '<<<PAGE_START:';
const PAGE_MARKER_END = '>>>';

// Get ALL items, not just the first one
const allItems = $input.all();
console.log('Total items received:', allItems.length);

// Create an array of markdown strings with page markers
const markdownArray = allItems.map((item, itemIndex) => {
  // Each item.json should have index, markdown, images, dimensions
  const pageNumber = item.json.index !== undefined ? item.json.index : itemIndex;
  const pageMarker = `${PAGE_MARKER_START}${pageNumber}${PAGE_MARKER_END}`;

  console.log(`Processing page ${pageNumber}, has markdown:`, !!item.json.markdown);

  // Insert page marker at the beginning of each page's content
  return `${pageMarker}\n\n${item.json.markdown}`;
});

console.log('Total pages processed:', markdownArray.length);
console.log('First page preview:', markdownArray[0].substring(0, 100));

// Join all markdown strings with newlines
const concatenatedMarkdown = markdownArray.join('\n');

// Return one item with markdown as a single string
return [{
  json: {
    content: concatenatedMarkdown
  }
}];

