// Safely access uploaded_images from Merge1
const mergeItem = $('Merge2').item;
const uploadedImages = mergeItem?.json?.uploaded_images;

let markdown = $json.markdown;
const supabaseBaseUrl = $('Supabase_account_details1').item.json.supabase_base_url;
const bucketName = $('Supabase_account_details1').item.json.supabase_storage_bucket_name;
const fullBaseUrl = `${supabaseBaseUrl}/storage/v1/object/public/${bucketName}/`;

// Only run replacement if uploadedImages is a non-empty array
if (Array.isArray(uploadedImages) && uploadedImages.length > 0) {
  for (const image of uploadedImages) {
    const originalId = image.original_id;
    const fileName = image.file_name;
    const annotation = image.image_annotation || '';

    const localMarkdownPattern = `![${originalId}](${originalId})`;
    const hostedMarkdownWithAnnotation = `![${originalId}](${fullBaseUrl}${fileName})\n\n${annotation}`;

    if (markdown.includes(localMarkdownPattern)) {
      markdown = markdown.replaceAll(localMarkdownPattern, hostedMarkdownWithAnnotation);
    }
  }
}

return {
  json: {
    ...$json,
    markdown
  }
};

